import React from "react";
import {
  TPTable1,
  TPContainer,
  TPtd,
  TPLinks,
  TPTitleText,
  SUPaTag,
} from "./styles";
import { FiPaperclip } from "react-icons/fi";
import { SiGmail } from "react-icons/si";
import {
  FaMediumM,
  FaUniversity,
  FaRegCalendarAlt,
  FaGoogleDrive,
} from "react-icons/fa";
import { AiOutlineTool } from "react-icons/ai";

const ToolsPage = () => {
  return (
    <TPContainer>
      <TPTitleText>
        <AiOutlineTool />
        {"\u00A0 "} Tools
      </TPTitleText>
      <TPTable1>
        <tr>
          <TPtd>
            <SUPaTag
              href={"https://mail.google.com/mail/u/1/#inbox"}
              target="_blank"
            >
              <SiGmail /> {"\u00A0 "}Email
            </SUPaTag>
          </TPtd>
          <TPtd>
            <SUPaTag
              href={"https://mail.google.com/mail/u/1/#inbox"}
              target="_blank"
            >
              <SiGmail /> {"\u00A0 "}Email
            </SUPaTag>
          </TPtd>
        </tr>
      </TPTable1>
    </TPContainer>
  );
};

export default ToolsPage;
